import React from "react";
import { Route, Routes, useLocation } from "react-router-dom";
import { createBrowserHistory } from "history";

import { Welcome, Works } from "../pages/";
import { AnimatePresence } from "framer-motion";
import { GlobalStyle } from "../pages/sharedStyle";

const history = createBrowserHistory();

const App = () => {
  const location = useLocation();

  return (
    <>
      <GlobalStyle />
      <AnimatePresence exitBeforeEnter>
        <Routes location={location} key={location.pathname}>
          <Route history={history} path="/" element={<Welcome />} />
          <Route
            path="*"
            element={
              <main style={{ padding: "1rem" }}>
                <p>There's nothing here!</p>
              </main>
            }
          />
          {/* <Route history={history} path="/works" element={<Works />} /> */}
          {/* <Route history={history} render={() => <div>404 NOT FOUND.</div>} /> */}
        </Routes>
      </AnimatePresence>
    </>
  );
};

export default App;
